import React from "react";

import Main from "./Main";
import Searchbox from "./Searchbox";
import Annonces from "./Annonces";

const Homepage = () => {
  return (
    <>
      <Main />
      <Searchbox />
      <Annonces />
    </>
  );
};

export default Homepage;
